import React, { useEffect } from "react";
import "./App.css";
import Navbar from "./Navbar";
import web from "../src/images/myimg.jpg";
import Card from "./Card";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import "../node_modules/bootstrap/dist/js/bootstrap.bundle";
import myimg from "../src/images/myimg.jpg";
import { NavLink } from "react-router-dom";
import Sdata from "./Sdata";
import Aos from "aos";
import "aos/dist/aos.css";

function Services() {
  useEffect(() => {
    Aos.init({ duration: 1000, easing: "ease-in-sine" });
  }, []);
  return (
    <>
      <Navbar />
      <div className="container-fluid">
        <div className="row">
          <div className="col-10 mx-auto bg-light">
            <h2 className="text-center" style={{ fontFamily: "caveeat" }}>
              My Services
            </h2>
            <p className="d-4 text-dark" style={{ fontFamily: "caveeat" }}>
              I design broad variety of designs which your business need to grow
              at resonable prices, I have years of experince with industry and
            </p>
          </div>
        </div>
      </div>
      <div className="container-fluid mt-5">
        <div className="row">
          <div className="col-10 mx-auto bg-light">
            <div className="row gy-4">
              {Sdata.map((v, i) => {
                return (
                  <Card
                    key={i}
                    imgsrc={v.img}
                    ctitle={v.title}
                    ctext={v.text}
                  />
                );
              })}
            </div>
          </div>
        </div>
      </div>

      <div className="bottomSection">
        <div className="container-fluid mt-5">
          <div className="row">
            <div className="col-6 mt-4 bg-success">
              <h2 className="text-center ">If your need any of serive</h2>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default Services;
